def rewriteDebugText(text, trial=0):
    final_text = ''
    for seq, line in enumerate(text.readlines()):
        if not line == '\n':
            new_line = '{}, {}, {}'.format(trial, seq, line)
            final_text += new_line
    return final_text


debug_text = io.StringIO(debug_text)


def parseRangingData(path, alt_min=-250, alt_max=15000, power_min=-4, power_max=20):
    df = None
    num_valid = 0
    num_total = 0
    with open(path, 'r') as file:
        data = { 'trial': [], 'sequence': [], 'power': [],
            'sats_tx': [], 'sats_rx': [], 'rssi': [],
            'timestamp': [], 'alt_tx': [], 'alt_rx': [],
            'lat_tx': [], 'lon_tx': [],
            'lat_rx': [], 'lon_rx': [],
        }

        for line in file.readlines():
            line = line.strip()
            if not line == '':
                num_total += 1
                segments = line.split(',')
                if len(segments) == 13:
                    try:
                        trial = int(segments[0])
                        if trial < 0:
                            continue
                        sequence = int(segments[1])
                        if sequence < 0:
                            continue
                        power = int(segments[2])
                        if (power > power_max) or (power < power_min):
                            continue
                        sats_tx = int(segments[3])
                        if sats_tx < 0:
                            continue
                        sats_rx = int(segments[4])
                        if sats_rx < 0:
                            continue
                        rssi = int(segments[5])
                        timestamp = int(segments[6])
                        alt_tx = float(segments[7])
                        if (alt_tx > alt_max) or (alt_tx < alt_min):
                            continue
                        alt_rx = float(segments[8])
                        if (alt_rx > alt_max) or (alt_rx < alt_min):
                            continue
                        lat_tx = float(segments[9])
                        if (lat_tx > 90) or (lat_tx < -90):
                            continue
                        lon_tx = float(segments[10])
                        if (lat_tx > 180) or (lat_tx < -180):
                            continue
                        lat_rx = float(segments[11])
                        if (lat_rx > 90) or (lat_rx < -90):
                            continue
                        lon_rx = float(segments[12])
                        if (lon_rx > 180) or (lon_rx < -180):
                            continue

                        data['trial'].append(trial)
                        data['sequence'].append(sequence)
                        data['power'].append(power)
                        data['sats_tx'].append(sats_tx)
                        data['sats_rx'].append(sats_rx)
                        data['rssi'].append(rssi)
                        data['timestamp'].append(timestamp)
                        data['alt_tx'].append(alt_tx)
                        data['alt_rx'].append(alt_rx)
                        data['lat_tx'].append(lat_tx)
                        data['lon_tx'].append(lon_tx)
                        data['lat_rx'].append(lat_rx)
                        data['lon_rx'].append(lon_rx)
                        num_valid += 1
                    except ValueError as _:
                        pass
                else:
                    pass
    print('total = {}, valid = {}'.format(num_total, num_valid))
    return pd.DataFrame(data)


def filterDistance(df, distance_m=1000):
    deg_per_m_lat = (360 / 40.075e6)
    lat_ref = df['lat_rx'].mean()
    lon_ref = df['lon_rx'].mean()
    deg_per_m_lon = deg_per_m_lat / math.cos(math.radians(lat_ref))
    valid_lats_tx = np.abs(df['lat_tx'] - lat_ref) <= distance_m * deg_per_m_lat
    valid_lats_rx = np.abs(df['lat_rx'] - lat_ref) <= distance_m * deg_per_m_lat
    valid_lons_tx = np.abs(df['lon_tx'] - lon_ref) <= distance_m * deg_per_m_lon
    valid_lons_rx = np.abs(df['lon_rx'] - lon_ref) <= distance_m * deg_per_m_lon
    valid_mask = valid_lats_tx & valid_lats_rx & valid_lons_tx & valid_lons_rx
    df = df[valid_mask.values].copy()
    m_per_deg = (1.0/deg_per_m_lat, 1.0/deg_per_m_lon)
    distances = np.sqrt(
        (m_per_deg[0] * (df['lat_tx'] - df['lat_rx']))**2
        + (m_per_deg[1] * (df['lon_tx'] - df['lon_rx']))**2
    )
    df['distance'] = distances
    aspect = m_per_deg[0] / m_per_deg[1]
    return df, aspect


def filterSatellites(df, satellites=12):
    max_satellites = 30
    valid_sats_rx = (df['sats_rx'] >= satellites) & (df['sats_rx'] < max_satellites)
    valid_sats_tx = (df['sats_tx'] >= satellites) & (df['sats_tx'] < max_satellites)
    valid_mask = valid_sats_rx & valid_sats_tx
    return df[valid_mask.values]


def correctReferenceShift(df):
    lat_ref, lon_ref = df['lat_rx'].mean(), df['lon_rx'].mean()
    lat_shift, lon_shift = (df['lat_rx'] - lat_ref), (df['lon_rx'] - lon_ref)
    # df['lat_tx'] -= lat_shift
    # df['lon_tx'] -= lon_shift
    return df, (lat_ref, lon_ref), (df['lat_rx'].std(), df['lon_rx'].std())


def plotGPSPosition(df, view_aspect, path_hue='rssi'):
    fig, ax = plt.subplots(1, constrained_layout=True)
    ax.set_title('GPS Position')
    sns.scatterplot(x='lon_rx', y='lat_rx', data=df, ax=ax, alpha=0.5, fc='deeppink', ec='none')
    sns.scatterplot(x='lon_tx', y='lat_tx', hue=path_hue, data=df, ax=ax, alpha=0.5, ec='none', palette="viridis")
    ax.set_aspect(view_aspect)
    print('Lat Range = {}'.format(ax.get_ylim()))
    print('Lon Range = {}'.format(ax.get_xlim()))


def plotRSSIvsDistance(df):
    def rssiFunc(xs, a, b, c):
        return a*xs[0] + b*xs[1] + c

    xs = np.log(df['distance'])
    ys = df['rssi']
    popt, pcov = scipy.optimize.curve_fit(rssiFunc, xs, ys)
    print(popt)
    print(pcov)

    max_range_rssi = -137
    rssi_group = df.groupby('power')
    rssi_graphs = len(rssi_group)
    fig, ax = plt.subplots(1, sharex=True, constrained_layout=True)
    fig.suptitle('RSSI vs. Distance')
    ax.set_xlabel('Distance in meters')
    ax.set_ylabel('RSSI in dB')
    cm = matplotlib.cm.get_cmap('viridis')
    # cm = matplotlib.cm.get_cmap('Blues')
    colors = [cm(x) for x in np.linspace(0.15, 0.9, len(rssi_group), endpoint=True)]
    fit_distances = np.linspace(1, df['distance'].max(), 250, endpoint=True)
    log_fit_distances = np.log(fit_distances)
    for (power, df_group), color in zip(rssi_group, colors):
        rssis = np.array(df_group['rssi'])
        distances = np.array(df_group['distance'])
        distances[distances <= 0] = 1
        log_distances = np.log(distances)
        if len(rssis) > 3:  # TODO: DECIDE HOW MANY SAMPLES ARE NECESSARY TO PROCESS POWERS....
            sns.scatterplot(x=distances, y=rssis, ax=ax, alpha=0.3, fc=color, ec='none')
            poly = nppp.Polynomial.fit(log_distances, rssis, deg=1)
            print(poly)
            fit_rssis = poly(log_fit_distances)
            range_poly = poly - max_range_rssi
            r_max = math.exp(range_poly.roots()[0]) / 1000
            sns.lineplot(x=fit_distances, y=fit_rssis, ax=ax, alpha=0.9, color=color, lw=2, label='Power {} dB (Max. {:0.2f} km)'.format(power, r_max))
    rssi_min, rssi_max = df['rssi'].min(), df['rssi'].max()
    ax.set_ylim(rssi_min-10, rssi_max+10)
    ax.axhline(max_range_rssi, c='deeppink', alpha=0.35)


